# Register: adadmins
from typing import List
from core.gunnershell.bofs.base import Bof, register
from colorama import Style, Fore

brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
reset = Style.RESET_ALL

def _is_ip(s: str) -> bool:
    if not s: return False
    s = s.strip("[]")
    parts = s.split(".")
    if len(parts) == 4:
        try:
            return all(0 <= int(p) <= 255 for p in parts)
        except ValueError:
            pass
    if ":" in s:
        hextets = s.split(":")
        if 2 <= len(hextets) <= 8 and all((h == "" or (1 <= len(h) <= 4 and all(c in "0123456789abcdefABCDEF" for c in h))) for h in hextets):
            return True
    return False

def _space_escape_item(s: str) -> str:
    # Percent-escape spaces so they survive any arg splitting; C side decodes %20
    return (s or "").strip().strip('"').replace(" ", "%20")

DEFAULT_GROUPS = [
    "Domain Admins",
    "Enterprise Admins",
    "Schema Admins",
    "Administrators",
    "Account Operators",
    "Backup Operators",
    "Server Operators",
    "Print Operators",
    "Group Policy Creator Owners",
]

@register("adadmins")
class AdAdminsBof(Bof):
    base64bof: str = ""
    x86base64bof: str = ""

    def help_menu():
        menu = """
adadmins — Find Domain Admins / Privileged Groups

Purpose
  Extract all privileged group memberships (Domain Admins, Enterprise Admins, Schema Admins, etc.).

Usage
  bofexec adadmins [-d <domain>] [--dc <hostname>] [--dc-ip <ip>] [--ldaps] [--port <int>] \\
                   [--groups "<csv>"] [--names] [--attributes <csv|*>]

Connection
  -d, --domain <dns>    DNS name of the target AD domain (e.g., contoso.com). Used for DC discovery/BaseDN.
  --dc <hostname>       DC hostname/FQDN (preferred).
  --dc-ip <ip>          DC IP address (optional).
  --ldaps               Use LDAPS (default 636). If not set -> LDAP (default 389).
  --port <int>          Override port.

Selection & Output
  --groups "<csv>"      Comma-separated group names to enumerate. Default is core admin groups.
  --names               Print only account names (sAMAccountName -> cn -> DN).
  --attributes <csv|*>  Attributes to print for each member (default: "*", i.e., all).

Examples
  bofexec adadmins --names
  bofexec adadmins --groups "Domain Admins,Enterprise Admins" --attributes "sAMAccountName,memberOf"
"""
        print(brightgreen + menu + reset)
        return

    @staticmethod
    def args_inject(p):
        # Connection / discovery
        p.add_argument("-d", "--domain", default="", help="DNS domain (e.g., contoso.com)")
        p.add_argument("--dc", default="", help="Domain Controller hostname/FQDN")
        p.add_argument("--dc-ip", default="", help="Domain Controller IP address")
        p.add_argument("--ldaps", action="store_true", default=False, help="Use LDAPS (default 636)")
        p.add_argument("--port", type=int, default=0, help="LDAP/LDAPS port (0 => default by scheme)")

        # Search / output
        p.add_argument("--groups", default="", help="CSV of privileged group names (default: core set)")
        p.add_argument("--names", action="store_true", default=False, help="List only account names")
        p.add_argument("-a", "--attributes", default="*", help='CSV of attributes, or "*" for all (default "*")')

    @staticmethod
    def build_remote_args(ns) -> List[str]:
        dc_host  = getattr(ns, "dc", "") or ""
        dc_ip    = getattr(ns, "dc_ip", "") or ""
        domain   = getattr(ns, "domain", "") or ""

        if dc_host and _is_ip(dc_host):
            raise ValueError("--dc expects a hostname/FQDN. Use --dc-ip for IPs.")

        use_ldaps = 1 if getattr(ns, "ldaps", False) else 0
        port_in   = int(getattr(ns, "port", 0) or 0)
        port      = port_in if port_in > 0 else (636 if use_ldaps else 389)

        namesOnly = 1 if getattr(ns, "names", False) else 0
        attrsCSV  = getattr(ns, "attributes", "*") or "*"

        groups_in = getattr(ns, "groups", "") or ""
        if not groups_in:
            groups_in = ",".join(DEFAULT_GROUPS)
        # Percent-escape spaces on each item so transport never truncates at spaces
        groupsEsc = ",".join(_space_escape_item(g) for g in groups_in.split(","))

        # Pack order must match entry.c header
        return [
            f"-Z:{dc_host}",     # 1
            f"-Z:{dc_ip}",       # 2
            f"-Z:{domain}",      # 3
            f"-i:{use_ldaps}",   # 4
            f"-i:{port}",        # 5
            f"-Z:{groupsEsc}",   # 6
            f"-i:{namesOnly}",   # 7
            f"-Z:{attrsCSV}",    # 8
        ]
